import React from 'react';

class App extends React.Component{
    render(){
        return(
            <div>
                <Header/>
                <Content/>
            </div>
            
        );
    }
}
class Header extends React.Component{
    render(){
        return(
            <h2>this is header</h2>
        );
    }
}
class Content extends React.Component{
    render(){
        return(
            <p>writing from content component</p>
        );
    }
}

export default App;
